import React, {Component} from 'react';
import {WriterWrapper, WriterItem} from '../style';

class Writer extends Component {
	render() {
		return (
			<WriterWrapper>
				<p className='writerHeader'>推荐作者<span className='changeWriter'><span className='iconfont'>&#xe61d;</span>换一批</span></p>
				<WriterItem>
					<a href='/'><img className='writerImages' src='./images/writer1.webp' alt='writerImages' /></a>
					<a href='/' className='writerName'>北美之美</a>
					<span className='addFocus'><span className='iconfont'>&#xe644;</span>关注</span>
					<p className = 'writerDetail'>写了439.8k字 · 29.1k喜欢</p>
					
				</WriterItem>
				<a className='showAll'>查看全部<span className='iconfont'>&#xe616;</span></a>
			</WriterWrapper>
		)
	}
}

export default Writer;
